import { Item } from '../Item/Item';

export const ItemList = ( {listProducts} ) => {

  return (

    <div className="products container">
      <h1>Tienda</h1>
      { listProducts.map( (products) => 
        (<Item 
          products={products} 
        />) 
      ) }
    </div>

  )
};
